export default [
{
theme:"Bober",
joke:"- Wiera, dlaczego ty sobie nie ogolisz bobra?! - Anton, przy twojej pensji to jedyne futro, na jakie mogę sobie pozwolić"
},
{
theme:"Kochanka",
joke:"- Kochanie czy mój tyłek wygląda w tym grubo? - Chcesz znać prawdę? - Tak. - Sypiam z twoją siostrą."
},
{
    theme:"Dracula",
    joke:"Przychodzi Hrabia Drakula do Baru i mówi do Barmana: - Poproszę szklankę wrzątku.  Zdziwiony dziwnym zamówieniem Barman odpowiada: - Wrzątku? Od kiedy Drakula pije wrzątek zamiast krwi?!  Na to Drakula wyjmuje z kieszeni zużyty tampon i mówi: Herbatkę sobie pie*dolnę!"
}
]
